import { Auth } from '../components'

const mapDispatchToProps = dispatch => ({
  getDatas: bindActionCreators(getDatas, dispatch),
})

export default compose(
  connect(
    null,
    mapDispatchToProps,
  ),
  withHandlers({
    onSubmit: props => (event) => {

    },
  }),
)(Auth)
